using System;using C=System.Console; class Player{static void Main(string[] args){ string[] i =C.ReadLine().Split(' '); int lX =int.Parse(i[0]); int lY =int.Parse(i[1]); int ix =int.Parse(i[2]); int iy =int.Parse(i[3]); int mX =lX-ix; int mY =lY-iy;while(true){C.ReadLine();if(mX>0){if(mY>0){mX-=1;mY-=1;C.WriteLine("SE");}else if(mY<0){mX-=1;mY += 1;C.WriteLine("NE");}else{mX-=1;C.WriteLine("E");}}else if(mX<0){if(mY>0){mX+=1;mY-=1;C.WriteLine("SW");}else if(mY<0){mX+=1;mY+=1;C.WriteLine("NW");}else{mX+=1;C.WriteLine("W");}}else{if(iy<lY){C.WriteLine("S");}else if(iy>lY){C.WriteLine("N");}}}}}